import axios from 'axios';

const default64 = ''

import Art from "@models/Art";
import { connectToDB } from "@utils/database";

export const POST = async (request) => {
    const data = await request.json();

    // // If seed is empty, exclude it in the data
    // if (data.seed === undefined) {
    //     delete data.seed;
    // }

    try {
        const options = {
            method: 'POST',
            url: 'https://api.getimg.ai/v1/stable-diffusion/text-to-image',
            headers: {
                accept: 'application/json',
                'content-type': 'application/json',
                authorization: `Bearer ${process.env.SDK_AUTH}`
            },
            data: {
                model: data.model,
                prompt: `${data.prompt}`,
                negative_prompt: `${data.negative_prompt}`,
                width: data.width,
                height: data.height,
                steps: data.steps,
                guidance: data.guidanceScale,
                seed: data.seed,
                scheduler: data.sampler
            }
        };
        // console.log(options, data.address)

        // const res = await axios.request(options);

        // for development
        function sleep(ms) {
            return new Promise(resolve => setTimeout(resolve, ms));
        }
        await sleep(3000)
        // fake res
        const res = {
            data: {
                image: default64,
                seed: 0
            }
        }

        // connect to database to store art
        await connectToDB()

        console.log(data)

        const newArt = new Art({
            address: data.address,
            base64: res.data.image,
            seed: res.data.seed,
            model: data.model,
            prompt: `${data.prompt}`,
            negative_prompt: `${data.negative_prompt}`,
            width: data.width,
            height: data.height,
            steps: data.steps,
            guidance: data.guidanceScale,
            scheduler: data.sampler
        });

        await newArt.save();

        return new Response(
            JSON.stringify(res.data),
            { status: 200 }
        )
    } catch (error) {
        console.log(error)
        return new Response(JSON.stringify({
            message: 'Failed to create a new prompt',
            error: error
        }), { status: 500 });
    }
}

export const GET = async (request, { params }) => {

    try {
        await connectToDB()

        const art = await Art.findAll();

        return new Response(
            JSON.stringify({ art: art }),
            { status: 200 }
        )
    } catch (error) {
        console.log(error)
        return new Response(JSON.stringify({
            message: 'Failed to get',
            error: error
        }), { status: 500 });
    }
}